INSERT INTO `answer` VALUES ('-kHmr6t3c6UHWGHb6hjPS','2021-07-21 09:29:22.185851','2021-07-21 09:29:22.185851',NULL,'1','FCyIzfsDHwnF_0jLoDGz6','03uDz0hwW3dIbNUY0CaAn'),('5acdFsR0-d0fJhkDSGLIN','2021-07-21 09:02:02.697285','2021-07-21 09:02:02.697285',NULL,'12','2MrOmJLJDU4EpR7HkK-dU','03uDz0hwW3dIbNUY0CaAn'),('cJtlrAuktIDwNmJoGkCNh','2021-08-20 07:04:44.539959','2021-08-20 07:04:44.539959',NULL,'Về vấn đề này, Tổng cục Thuế đã có công văn số 5032/TCT-CS ngày 26/11/2020 hướng dẫn về chính sách thuế đối với chi phí cách ly phòng chống dịch Covid 19 của Chuyên gia nước ngoài. Căn cứ tại Điều 4 Thông tư số 96/2015/TT-BTC ngày 22/6/2015 của Bộ Tài chính hướng dẫn về thuế thu nhập doanh nghiệp thì: Đối với chi phí cách ly tại khách sạn và chi phí điều trị cho chuyên gia nước ngoài mà doanh nghiệp ký hợp đồng lao động với người lao động trong đó có ghi khoản chi về tiền nhà do doanh nghiệp trả cho người lao động thì khoản chi phí trả cho cơ sở cách ly được tính vào chi phí được trừ khi xác định thu nhập chịu thuế thu nhập doanh nghiệp nếu có đầy đủ hóa đơn, chứng từ và thanh toán theo quy định.','K03j6Fl_dklyR5_6ZWjy6','nVOdtrQkGL8HrHKvLQq8e'),('DUbavymCJZBoMcEEPGyWI','2021-07-21 09:16:09.140523','2021-07-21 09:16:09.140523',NULL,'33','2MrOmJLJDU4EpR7HkK-dU','03uDz0hwW3dIbNUY0CaAn'),('hBjH4b_ATSfqAKVgBC3K1','2021-07-21 09:07:46.872664','2021-07-21 09:07:46.872664',NULL,'13','2MrOmJLJDU4EpR7HkK-dU','03uDz0hwW3dIbNUY0CaAn'),('hDIYFRajBi2CJij3ElGT7','2021-07-21 09:19:22.392837','2021-07-21 09:19:22.392837',NULL,'1','DmJV7udfCXFoDRCG801km','03uDz0hwW3dIbNUY0CaAn'),('iDb5Rq14-coFv7eQIeajN','2021-07-21 09:29:59.746143','2021-07-21 09:29:59.746143',NULL,'yah','QaFnOwYMBLdVBFOtl38Vf','03uDz0hwW3dIbNUY0CaAn'),('r6ew9tRUWcw8q8OBYHikY','2021-08-20 07:05:10.492614','2021-08-20 07:05:10.492614',NULL,'Bạn có thể để mình tư vấn kỹ hơn khi đặt lịch tư vấn nhé','K03j6Fl_dklyR5_6ZWjy6','nVOdtrQkGL8HrHKvLQq8e'),('sZvTgjTTzzRebS4WGJ-BF','2021-07-31 15:28:23.113801','2021-07-31 15:28:23.113801',NULL,'Yo','onxkmCFZZSx8-QPXOKxj5','03uDz0hwW3dIbNUY0CaAn'),('UqfXql5jXjyGm7afEYyFN','2021-08-20 07:07:22.901460','2021-08-20 07:07:22.901460',NULL,'Trường hợp đơn vị có hoạt động kinh doanh hàng hóa, dịch vụ có thu nhập chịu thuế thu nhập doanh nghiệp mà đơn vị hạch toán được doanh thu, chi phí thì đơn vị kê khai quyết toán thuế TNDN theo mẫu 03/TNDN.\n\nTrường hợp đơn vị xác định được doanh thu nhưng không xác định được chi phí, thu nhập của hoạt động kinh doanh thì kê khai nộp thuế thu nhập doanh nghiệp theo tỷ lệ % trên doanh thu theo mẫu 04/TNDN.','K03j6Fl_dklyR5_6ZWjy6','oH2bGur0NdrGRukOOEhCk'),('vPKn3FPB_zTZ0u6wmfCzu','2021-07-21 09:17:53.197746','2021-07-21 09:17:53.197746',NULL,'1','DmJV7udfCXFoDRCG801km','03uDz0hwW3dIbNUY0CaAn');
