CREATE TABLE `notification_setting` (
  `id` char(21) NOT NULL,
  `created_date` datetime(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6),
  `updated_date` datetime(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) ON UPDATE CURRENT_TIMESTAMP(6),
  `title` varchar(150) DEFAULT NULL,
  `content` text NOT NULL,
  `receiver_roles` text NOT NULL,
  `notification_condition` text,
  `type` varchar(255) DEFAULT NULL,
  `notification_form` enum('once','repeat') NOT NULL,
  `notification_method` enum('web','email','sms') NOT NULL,
  `notify_at` datetime DEFAULT NULL,
  `repeat_start_date` datetime DEFAULT NULL,
  `repeat_interval` tinyint(3) unsigned DEFAULT NULL,
  `repeat_end_date` datetime DEFAULT NULL,
  `job_id` char(21) DEFAULT NULL,
  `job_status` enum('completed','waiting','delayed','failed','paused') DEFAULT NULL,
  `created_by_id` char(21) DEFAULT NULL,
  `updated_by_id` char(21) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `IDX_af85fd153b97ee9eacb505453f` (`id`),
  KEY `FK_b15488740fa28bdd43340d8cff8` (`created_by_id`),
  KEY `FK_b4483c8e667e2cbdd457fe87af8` (`updated_by_id`),
  CONSTRAINT `FK_b15488740fa28bdd43340d8cff8` FOREIGN KEY (`created_by_id`) REFERENCES `administrator` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_b4483c8e667e2cbdd457fe87af8` FOREIGN KEY (`updated_by_id`) REFERENCES `administrator` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
