INSERT INTO `typeorm_metadata` VALUES ('VIEW',NULL,'jbk_advisory_v2',NULL,'account_profile','SELECT ac.id                  AS account_id,\n          ac.registered_date     AS created_date,\n          ac.registered_date     AS registered_date,\n          ac.account_role        AS role,\n          cu.phone               AS phone,\n          cu.referer_phone       AS referer_phone,\n          cu.authorized_date     AS authorized_date,\n          cu.full_name           AS full_name,\n          cu.gender              AS gender,\n          cu.birthday            AS birthday,\n          cu.permanent_residence AS permanent_residence,\n          cu.account_type        AS account_type,\n          cu.email               AS email,\n          cu.province_or_city    as province,\n          cu.identity_number     as identity_number,\n          NULL                   AS realm,\n          NULL                   AS realm_years_experience,\n          NULL                   AS expertise,\n          NULL                   as expertise_years_experience\n    FROM account ac\n          INNER JOIN customer cu\n                      ON ac.id = cu.account_id\n    WHERE ac.account_role = \"customer\"\n      AND cu.deleted_at IS NULL\n      AND ac.delete_date IS NULL\n\n    UNION\n\n    SELECT ac.id                         AS account_id,\n          ac.registered_date            AS created_date,\n          ac.registered_date            AS registered_date,\n          ac.account_role               AS role,\n          co.phone                      AS phone,\n          co.referer_phone              AS referer_phone,\n          co.authorized_date            AS authorized_date,\n          co.full_name                  AS full_name,\n          co.gender                     AS gender,\n          co.birth_day                  AS birthday,\n          co.permanent_residence        AS permanent_residence,\n          co.account_type               AS account_type,\n          co.email                      AS email,\n          co.province                   as province,\n          co.identity_number            as identity_number,\n          co.realm                      AS realm,\n          co.realm_years_experience     AS realm_years_experience,\n          co.expertise                  AS expertise,\n          co.expertise_years_experience as expertise_years_experience\n    FROM account ac\n          INNER JOIN consultant co\n                      ON ac.id = co.account_id\n    WHERE ac.account_role = \"consultant\"\n      AND ac.delete_date IS NULL\n      AND co.deleted_at IS NULL\n\n    UNION\n\n    SELECT ac.id              AS account_id,\n          ac.registered_date AS created_date,\n          ac.registered_date AS registered_date,\n          ac.account_role    AS role,\n          ad.phone           AS phone,\n          NULL               AS referer_phone,\n          NULL               AS authorized_date,\n          ad.fullname        AS full_name,\n          NULL               AS gender,\n          NULL               AS birthday,\n          NULL               AS permanent_residence,\n          NULL               AS account_type,\n          ac.username        AS email,\n          NULL               as province,\n          NULL               as identity_number,\n          NULL               AS realm,\n          NULL               AS realm_years_experience,\n          NULL               AS expertise,\n          NULL               as expertise_years_experience\n    FROM account ac\n          INNER JOIN administrator ad\n                      ON ac.id = ad.account_id\n    WHERE ac.account_role = \"admin\"\n      AND ac.delete_date IS NULL\n      AND ad.delete_date IS NULL');
/*!40000 ALTER TABLE `typeorm_metadata` ENABLE KEYS */;
UNLOCK TABLES;

